import React, {Component} from 'react';
import Invitation from "./Invitation";
import soloInvitationImage from '../../assets/solo-image.jpg';

function InvitationSection(props) {
        return (
            <div className="invitation-section">
                <div className="container">
                    <div className="invitation-section__inner">
                        <Invitation title="Запрошую на індивідуальні консультації." text="Теми з якими я працюю: стосунки в сім'ї, парі, самооцінка та самоцінність, самореалізація, депресія, панічні атаки та страхи,
                                          психосоматичні симптоми, втрати, дитячий травматичний досвід, життєві ресурси, особисті кордони та інші.
                                          Проводжу супервізію для психологів та психотерапевтів." img={soloInvitationImage}/>
                    </div>
                </div>
            </div>
        );
}

export default InvitationSection;
